let myMap;

const init = () =>{

    var myMap = new ymaps.Map('map',{
        center: [55.751688, 37.604105],
        zoom: 13,
        controls: []
    });

    var coords = [
        [55.74344831594532, 37.580411528507426],
        [55.75803366807345, 37.58317508517665],
        [55.74973712934959, 37.60500786680653],
        [55.75838518050675, 37.62380938245144]
    ];
    const myCollection = new ymaps.GeoObjectCollection({}, {
        iconLayout: 'default#image',
        iconImageHref: './img/map-icon.svg',
        iconImageSize: [58, 73],
        iconImageOffset: [-25, -55],
        draggable: false
    });
    for (var i = 0; i < coords.length; i++) {
        myCollection.add(new ymaps.Placemark(coords[i]));
    }

    myMap.geoObjects.add(myCollection);
    myMap.behaviors.disable('scrollZoom')
}

ymaps.ready(init);
$(document).ready(function(){

    (function openMenu() {
        const menu = document.querySelector('.menu');
        const menuBtn = document.querySelector('.burger');
    
        menuBtn.addEventListener('click', function () {
            menu.classList.toggle('menu--active');
            menuBtn.classList.toggle('burger--active');
    
            if (menu.classList.contains('menu--active')){
                document.querySelector('.wrapper').style.overflow =  `hidden`;
                document.querySelector('.wrapper').style.height =  `100vh`;
            } else {
                document.querySelector('.wrapper').style.overflow = `scroll`;
            }
        });
    
        menu.addEventListener('click', function (e) {
            if (menu.classList.contains('menu--active') && e.target.classList.contains('menu__item-link')){
                menu.classList.toggle('menu--active');
                menuBtn.classList.toggle('active');
                document.querySelector('.wrapper').style.overflow = `scroll`;
            }
        })
    
    })();

});

const wrapper = $('.maincontent');
const sections = $('.section');
const fixedMenu = $('.fixed-menu');
const menuItems = fixedMenu.find('.fixed-menu__item');

sections.first().addClass('active');

let inScroll = false;

const countSectionPosition = sectionEq =>{
    return sectionEq * -100;
};

const changeMenuTheme = sectionEq =>{
    const currentSection = sections.eq(sectionEq);
    const menuTheme = currentSection.attr('data-fixedMenu-color');

    if(menuTheme === 'black'){
        fixedMenu.addClass('fixed-menu--shadowed');
    } else{
        fixedMenu.removeClass('fixed-menu--shadowed');
    }
};

const resetActiveClassForItem = (items, itemEq, activeClass) =>{
    items.eq(itemEq).addClass(activeClass).siblings().removeClass(activeClass);
};
const performTransition = sectionEq =>{

    if(inScroll === false){
        inScroll = true;

        const position = countSectionPosition(sectionEq);

        changeMenuTheme(sectionEq);

        wrapper.css({
            transform: `translateY(${position}%)`
        });

        resetActiveClassForItem(sections, sectionEq, 'active');
        resetActiveClassForItem(menuItems, sectionEq, 'fixed-menu__item--active');

        setTimeout(() =>{
            inScroll = false;
        }, 600);
    }

};

const scrollViewport = direction =>{

    const activeSection = sections.filter('.active');
    const nextSection = activeSection.next();
    const prevSection = activeSection.prev();

    if (direction === 'next' && nextSection.length){
        performTransition(nextSection.index());
    }
    if (direction === 'prev' && prevSection.length){
        performTransition(prevSection.index());
    }
};

$(window).on('wheel', e =>{
    const deltaY = e.originalEvent.deltaY;
    console.log(deltaY)

    if (deltaY > 0){
        scrollViewport('next');
    }
    if (deltaY < 0){
        scrollViewport('prev');
    } 

});

$(window).on('keydown', e =>{

    const tagName = e.target.tagName.toLowerCase();

    if(tagName !== 'input' && tagName !== 'textarea'){
        switch(e.keyCode){
            case 38:
                scrollViewport('prev');
                break;
            case 40:
                scrollViewport('next');
                break;
        }
    }

});
$('[data-scroll-to]').click(e =>{
    e.preventDefault();

    const attribute = $(e.currentTarget);
    const target = attribute.attr('data-scroll-to');
    const reqSection = $(`[data-section-id=${target}]`);

    performTransition(reqSection.index())
});

























